All 17 episodes plus the original pilot, the dvd intro scenes and the song from the new George of the Jungle

Easy to follow naming convention keeps episodes in order and allows for proper cataloging and playback in media players such as XBMC, etc.

Episodes are cut into segments, with the segments properly named. Opening sequences and closing credits are included, cut into thier own segments for easy removal or just skipping over.

The source material was interlaced and not very good. The size has been reduced and video cleaned up, but is still far from top quality. This should be around the same quality level that the original aired cartoon was viewed at back in the 60's.
